import React, { Component } from "react";
import "./Work.css";

class Work extends Component {
    render(){
        return (
            <div className="Work">
                <div className="Work-nav"></div>
                <div className="Work-videos">
                    <iframe src="https://player.vimeo.com/video/23660736" width="320" height="180" frameborder="0" allow="autoplay; fullscreen" allowfullscreen></iframe>
                    <iframe src="https://player.vimeo.com/video/23660736" width="320" height="180" frameborder="0" allow="autoplay; fullscreen" allowfullscreen></iframe>
                    <iframe src="https://player.vimeo.com/video/23660736" width="320" height="180" frameborder="0" allow="autoplay; fullscreen" allowfullscreen></iframe>
                </div>
            </div>
        )
    }
}

export default Work;
